///
/// This advances the parser to the first character immediately following
/// the primitive.
fn parse_primitive(&self) -> Result<Primitive> {
    match self.char() {
        '\\' => self.parse_escape(),
        '.' => {
            let ast = Primitive::Dot(self.span_char());
            self.bump();
            Ok(ast)
        }
