                span: self.span_char(),
                kind: ast::AssertionKind::EndLine,
            });
            self.bump();
            Ok(ast)
        }
        c => {
            let ast = Primitive::Literal(ast::Literal {
                span: self.span_char(),
                kind: ast::LiteralKind::Verbatim,
                c: c,
            });
            self.bump();
            Ok(ast)
        }
    }
}
